import React, { Component } from 'react';
import { Route, Redirect } from 'react-router-dom';

export const ProtectedRoute = ({ loggedIn, ...props}) => {
  return (
    <Route>
      {() =>
        props.loggedIn ? <Component {...props} /> : <Redirect to="/sign-up" />
      }
    </Route> 
  );
};
